import React from 'react'
import navbar from "../components/Navbar/Index"

const Dashboard = () => {
    const { user: currentUser } = useSelector((state) => state.auth);

    if (!currentUser) {
      return <Redirect to="/login" />;
    }
    return (
        <div>
            <navbar/>
        </div>
    )
}

export default Dashboard
